import React from "react";
import {
    Box,
    Center,
    Flex,
    Checkbox,
    Stack,
    Heading,
    Text,
    Button,
} from "@chakra-ui/react";

const Quiz = () => {
    return (
        <Box w={"100%"}>
            <Center h={"100%"}>
                <Flex
                    p={4}
                    w={"50%"}
                    direction={"column"}
                    alignContent="center"
                    alignItems="flex-start"
                >
                    {[1, 1, 2, 3, 3].map((item) => (
                        // Question
                        <Box
                            pb={5}
                            bg="grey"
                            mb={1}
                            mt={1}
                            w="100%"
                            p={4}
                            borderRadius={10}
                        >
                            {/* Title */}
                            <Text fontSize="xl">This is message 1</Text>
                            {/* Options Group */}
                            <Stack spacing={2} direction={"column"}>
                                <Checkbox colorScheme="green">
                                    Checkbox
                                </Checkbox>
                                <Checkbox colorScheme="green">
                                    Checkbox
                                </Checkbox>
                            </Stack>
                        </Box>
                    ))}
                    <Button alignItems="flex-end" colorScheme="blue">
                        Button
                    </Button>
                </Flex>
                {/* End of questions */}
            </Center>
        </Box>
    );
};

export default Quiz;
